import useFetchData from "../hooks/useFetchData";

const CategoryInfo = ({id}) => {

    const {
        data,
        loading
    } = useFetchData("http://127.0.0.1:5000/category", {id: id});

    if (loading) {
        return (<h1>Loading...</h1>);
    } else if (data) {
        console.log(data);
    }

};

export default CategoryInfo;
